- proto: Paper
  entities:
  - uid: 49
    components:
    - type: Transform
      pos: 2.2703333,11.677603
      parent: 1
    - type: Paper
      content: Это свалившиеся с неба ответы на вопросы, которые мы еще не умеем задать.
  - uid: 50
    components:
    - type: Transform
      pos: 2.2859583,11.130728
      parent: 1
    - type: Paper
      content: Самый героический поступок человечества – это то, что оно выжило и намерено выжить дальше…
  - uid: 51
    components:
    - type: Transform
      pos: 2.4734583,11.052603
      parent: 1
    - type: Paper
      content: 'С Зоной ведь так: с хабаром вернулся – чудо, живой вернулся – удача, патрульная пуля – везенье, а все остальное – судьба…'
  - uid: 52
    components:
    - type: Transform
      pos: 2.6140833,10.708853
      parent: 1
  - uid: 53
    components:
    - type: Transform
      pos: 2.4265833,9.755728
      parent: 1
  - uid: 54
    components:
    - type: Transform
      pos: 4.3172083,11.849478
      parent: 1
    - type: Paper
      content: Гипотеза о Боге, например, дает ни с чем не сравнимую возможность абсолютно все понять, абсолютно ничего не узнавая…
  - uid: 55
    components:
    - type: Transform
      pos: 4.7547083,11.740103
      parent: 1
    - type: Paper
      content: Разум есть способность использовать силы окружающего мира без разрушения этого мира.
  - uid: 56
    components:
    - type: Transform
      pos: 4.0984583,11.536978
      parent: 1
    - type: Paper
      content: >
        Вся беда в том, что мы не замечаем, как проходят годы, думал он. Плевать на годы – мы не замечаем, как все меняется. Мы знаем, что все меняется, нас с детства учат, что все меняется, мы много раз видели своими глазами, как все меняется, и в то же время мы совершенно не способны заметить тот момент, когда происходит изменение, или ищем изменение не там, где следовало бы.
  - uid: 57
    components:
    - type: Transform
      pos: 5.3172083,11.552603
      parent: 1
    - type: Paper
      content: Но вся беда в том, что человек, во всяком случае массовый человек, с легкостью преодолевает эту свою потребность в знаниях. По-моему, у него такой потребности и вовсе нет. Есть потребность понять, а для этого знаний не надо. Гипотеза о Боге, например, дает ни с чем не сравнимую возможность абсолютно все понять, абсолютно ничего не узнавая…
  - uid: 58
    components:
    - type: Transform
      pos: 5.9422083,11.708853
      parent: 1
    - type: Paper
      content: Они ведь все, очкарики, такие. Им главное – название придумать. Пока не придумал, смотреть на него жалко, дурак дураком. Ну а как придумал какой-нибудь гравиконцентратор – тут ему словно все понятно становится, и сразу ему жить легче.
  - uid: 59
    components:
    - type: Transform
      pos: 6.0047083,11.396353
      parent: 1
    - type: Paper
      content: Пикник на обочине какой-то космической дороги.
  - uid: 60
    components:
    - type: Transform
      pos: 3.8328333,10.521353
      parent: 1
    - type: Paper
      content: Дайте человеку крайне упрощенную систему мира и толкуйте всякое событие на базе этой упрощенной модели. Такой подход не требует никаких знаний. Несколько заученных формул плюс так называемая интуиция, так называемая практическая сметка и так называемый здравый смысл.
  - uid: 61
    components:
    - type: Transform
      pos: 5.2390833,10.786978
      parent: 1
    - type: Paper
      content: Ты должен сделать добро из зла, потому что его больше не из чего сделать.
  - uid: 62
    components:
    - type: Transform
      pos: 5.9265833,10.474478
      parent: 1
    - type: Paper
      content: Человечество в целом – слишком стационарная система, ее ничем не проймешь.
  - uid: 63
    components:
    - type: Transform
      pos: 5.6140833,10.818228
      parent: 1
    - type: Paper
      content: 'Я иногда спрашиваю себя: какого черта мы так крутимся? Чтобы заработать деньги? Но на кой черт нам деньги, если мы только и делаем, что крутимся?..'
  - uid: 64
    components:
    - type: Transform
      pos: 6.5672083,11.411978
      parent: 1
    - type: Paper
      content: Придумать можно все, что угодно. На самом деле никогда не бывает так, как придумывают.
